import React, { useEffect } from 'react';
import Header from './Header';
import Nav from './Nav';
import Footer from './Footer';
import styles from './Gallery.module.css'
import photos from '../data/gallery.json'

function Gallery() {
  document.title = "TWICE: Gallery"

  return (
    <>
      <Header type='black'></Header>
      <Nav></Nav>
      <div className={`${styles.container} wow fadeInUp`} data-wow-duration='1s'>
        <div className={styles.title}>GALLERY</div>
        <div className={styles.galleryList}>
          {photos.map(i => 
          {if (i.ratio === 2) {
            return (
              <a data-fancybox="gallery" id={i.id} key={i.id} className={styles.gridSpan2} href={require("../img/gallery/"+i.imgUrl.split('/').slice(-2).join('/'))}>
                <img src={require("../img/gallery/"+i.imgUrl.split('/').slice(-2).join('/'))} alt="artist_photo"/>
              </a>
            )
          } else {
            return (
              <a data-fancybox="gallery" id={i.id} key={i.id} href={require("../img/gallery/"+i.imgUrl.split('/').slice(-2).join('/'))}>
                <img  src={require("../img/gallery/"+i.imgUrl.split('/').slice(-2).join('/'))} alt="artist_photo"/>
              </a>
            )
          }}
            )}
            <a class="grid-item jg-entry" href="https://lv2-cdn.azureedge.net/twice/1a58c13ce7f94ee5a05c54f45eceebee-01%20%E1%84%83%E1%85%A1%E1%86%AB%E1%84%8E%E1%85%A6_%E1%84%8F%E1%85%A5%E1%86%AB%E1%84%89%E1%85%A6%E1%86%B81_%E1%84%8F%E1%85%B3%E1%86%AF%E1%84%85%E1%85%B5%E1%86%AB%E1%84%87%E1%85%A9%E1%86%AB.jpg" data-fancybox="gallery" style="width: 268px; height: 191.167513px; top: 4px; left: 4px; opacity: 1;">
              <img src="https://lv2-cdn.azureedge.net/twice/cf4eefb2cd4545bc8caba5f8e29b77dc-01%20%E1%84%83%E1%85%A1%E1%86%AB%E1%84%8E%E1%85%A6_%E1%84%8F%E1%85%A5%E1%86%AB%E1%84%89%E1%85%A6%E1%86%B81_%E1%84%8F%E1%85%B3%E1%86%AF%E1%84%85%E1%85%B5%E1%86%AB%E1%84%87%E1%85%A9%E1%86%AB20230220055353214.jpg" alt="cf4eefb2cd4545bc8caba5f8e29b77dc-01%20%E1%84%83%E1%85%A1%E1%86%AB%E1%84%8E%E1%85%A6_%E1%84%8F%E1%85%A5%E1%86%AB%E1%84%89%E1%85%A6%E1%86%B81_%E1%84%8F%E1%85%B3%E1%86%AF%E1%84%85%E1%85%B5%E1%86%AB%E1%84%87%E1%85%A9%E1%86%AB20230220055353214.jpg" style="width: 268px; height: 192px; margin-left: -134px; margin-top: -96px;"/>
            </a>
        </div>
      </div>


      <Footer type='black-vertical'></Footer>
    </>
  );
}

export default Gallery;
